tle"},{"attributes":{"axis":{"id":"1190"},"ticker":null},"id":"1193","type":"Grid"},{"attributes":{"text":""},"id":"1223","type":"Title"},{"attributes":{},"id":"1123","type":"BasicTicker"},{"attributes":{},"id":"1051","type":"BasicTicker"},{"attributes":{"formatter":{"id":"1229"},"ticker":{"id":"1119"}},"id":"1118","type":"DatetimeAxis"},{"attributes":{},"id":"1114","type":"LinearScale"},{"attributes":{},"id":"1136","type":"ResetTool"},{"attributes":{"url":"./profile?key=@name"},"id":"1133","type":"OpenURL"},{"attributes":{"axis":{"id":"1085"},"dimension":1,"ticker":null,"visible":false},"id":"1088","type":"Grid"},{"attributes":{"data_source":{"id":"1145"},"glyph":{"id":"1166"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"1167"},"selection_glyph":null,"view":{"id":"1169"}},"id":"1168","type":"GlyphRenderer"},{"attributes":{},"id":"1231","type":"BasicTickFormatter"},{"attributes":{"child":{"id":"bk-task-stream-plot"},"title":"Task Stream"},"id":"1215","type":"Panel"},{"attributes":{"days":[1,8,15,22]},"id":"1258","type":"DaysTicker"},{"attributes":{"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 5.55 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 14410 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 5.09 s &lt;/li&gt;\n&lt;li&gt; disk-read time: 79.07 ms &lt;/li&gt;\n&lt;li&gt; transfer time: 1.50 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://127.0.0.1:35623 &lt;/li&gt;\n          &lt;li&gt; Workers: 10 &lt;/li&gt;\n          &lt;li&gt; Threads: 10 &lt;/li&gt;\n          &lt;li&gt; Memory: 540.94 GB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.01.1+13.gca81b897 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.01.1+11.g98570fbc &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\ndef main():\n    client = Client(n_workers=10, threads_per_worker=1)\n    print(client)\n\n    df = dask.datasets.timeseries(\n        start=\"2000-01-01\",\n        end=\"2000-01-31\",\n        # end=\"2000-12-31\",\n        partition_freq=\"1h\",\n        freq=\"60s\",\n    )\n    df = df.persist()\n    wait(df)\n    iterations = 10\n\n    with performance_report(filename=f\"{today}-simple-scheduler.html\"):\n        simple = []\n        # print('start simple: ', flush=True)\n        for i in range(iterations):\n            start = time.time()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.time()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.time()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.time()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.time()\n            df2.head()\n            stop = time.time()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    data = dsa.random.random((10000, 1000000), chunks=(1, 1000000))\n    da = xr.DataArray(data, dims=['time', 'x'],\n                      coords={'day': ('time', np.arange(10000) % 100)})\n    clim = da.groupby('day').mean(dim='time')\n    anom = da.groupby('day') - clim\n    anom_mean = anom.mean(dim='time')\n    with performance_report(filename=f\"{today}-anom-mean-scheduler.html\"):\n        anom_mean_t = []\n        for i in range(iterations):\n            start = time.time()\n            anom_mean.compute()\n            stop = time.time()\n            anom_mean_t.append(stop-start)\n\n        anom_mean_t = np.array(anom_mean_t)\n\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access,\n            anom_mean=anom_mean_t)\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{"source":{"id":"1036"}},"id":"1068","type":"CDSView"},{"attributes":{},"id":"1012","type":"BasicTicker"},{"attributes":{"data":{"bandwidth":[],"bandwidth-half":[],"bandwidth_text":[],"type":[]},"selected":{"id":"1277"},"selection_policy":{"id":"1276"}},"id":"1178","type":"ColumnDataSource"},{"attributes":{"axis":{"id":"1046"},"ticker":null,"visible":false},"id":"1049","type":"Grid"},{"attributes":{},"id":"1005","type":"DataRange1d"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","top_units":"screen"},"id":"1058","type":"BoxAnnotation"},{"attributes":{"months":[0,6]},"id":"1263","type":"MonthsTicker"},{"attributes":{},"id":"1265","type":"UnionRenderers"},{"attributes":{"data_source":{"id":"1001"},"glyph":{"id":"1030"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":null,"selection_glyph":null,"view":{"id":"1033"}},"id":"1032","type":"GlyphRenderer"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;p&gt;&lt;b&gt;Source:&lt;/b&gt; @source &lt;/p&gt;\n                &lt;p&gt;&lt;b&gt;Destination:&lt;/b&gt; @destination &lt;/p&gt;\n                &lt;p&gt;&lt;b&gt;Bandwidth:&lt;/b&gt; @bandwidth_text / s&lt;/p&gt;\n            &lt;/div&gt;\n            "},"id":"1176","type":"HoverTool"},{"attributes":{"dimensions"
